import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './styles.css'; // Import the CSS file here

const ResetPassword = () => {
  const [passwords, setPasswords] = useState({
    newPassword: '',
    confirmPassword: ''
  });

  const handleChange = (e) => {
    setPasswords({
      ...passwords,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle password update logic here
    console.log('Updating password:', passwords);
  };

  return (
    <div style={styles.container}>
      <div style={styles.leftSection}>
        <div style={styles.overlay}>
          <div style={styles.lockIconContainer}>
            {/* You can replace this with an actual lock icon */}
            <div style={styles.lockIcon}></div>
          </div>
          <p style={styles.leftText}>
            Enter your new password below to complete the reset process
          </p>
        </div>
      </div>
      
      <div style={styles.rightSection}>
        <div style={styles.formContainer}>
          <h1 style={styles.heading}>Create a New Password</h1>
          <p style={styles.subText}>
            Your new password must different from previous used password
          </p>
          
          <form onSubmit={handleSubmit} style={styles.form}>
            <div style={styles.inputGroup}>
              <input
                type="password"
                name="newPassword"
                placeholder="New Password"
                value={passwords.newPassword}
                onChange={handleChange}
                style={styles.input}
                required
              />
            </div>
            
            <div style={styles.inputGroup}>
              <input
                type="password"
                name="confirmPassword"
                placeholder="Confirm - password"
                value={passwords.confirmPassword}
                onChange={handleChange}
                style={styles.input}
                required
              />
            </div>
            
            <button type="submit" style={styles.button}>
              Update your password
            </button>
          </form>
        </div>
      </div>
    </div>
  );
};

const styles = {
  container: {
    display: 'grid',
    gridTemplateColumns: '1fr 1fr',
    minHeight: '100vh',
    fontFamily: 'Arial, sans-serif'
  },
  leftSection: {
    position: 'relative',
    backgroundColor: '#0078D4',
    backgroundImage: `url('/placeholder.svg?height=800&width=600')`,
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    color: 'white',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    padding: '2rem'
  },
  overlay: {
    textAlign: 'center',
    zIndex: 1,
    position: 'relative'
  },
  lockIconContainer: {
    marginBottom: '2rem'
  },
  lockIcon: {
    width: '120px',
    height: '120px',
    backgroundColor: 'rgba(255, 255, 255, 0.2)',
    borderRadius: '50%',
    margin: '0 auto'
  },
  leftText: {
    fontSize: '1.5rem',
    maxWidth: '400px',
    margin: '0 auto',
    lineHeight: '1.5'
  },
  rightSection: {
    backgroundColor: 'white',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    padding: '2rem'
  },
  formContainer: {
    width: '100%',
    maxWidth: '400px',
    padding: '0 1rem'
  },
  heading: {
    fontSize: '2rem',
    marginBottom: '1rem',
    color: '#333'
  },
  subText: {
    color: '#666',
    marginBottom: '2rem'
  },
  form: {
    display: 'flex',
    flexDirection: 'column',
    gap: '1.5rem'
  },
  inputGroup: {
    display: 'flex',
    flexDirection: 'column',
    gap: '0.5rem'
  },
  input: {
    padding: '0.75rem',
    fontSize: '1rem',
    border: 'none',
    borderBottom: '1px solid #ddd',
    outline: 'none',
    width: '100%'
  },
  button: {
    backgroundColor: '#0078D4',
    color: 'white',
    padding: '0.75rem',
    border: 'none',
    borderRadius: '4px',
    fontSize: '1rem',
    cursor: 'pointer',
    width: '100%',
    marginTop: '1rem'
  }
};

export default ResetPassword;
